import React from "react";
import "./gallery.css";

export default function Gallery() {
  return (
    <div className="scrollmenu">
      <div className="galleryContainer">
        <a className="galleryCard" href="#">
          <img src="/banner1.jpg" alt="" className="galleryCardPhoto" />
          <h3 className="galleryCardName">iPhone 13 Pro Max</h3>
          <p className="galleryCardPrice">$999999999999999999999999999999999</p>
        </a>
      </div>
    </div>
  );
}
